import "./News.css"

const  Template = (props) =>{
    const [visible,setV] = useState(false);
    const dispatch = useDispatch();
    const k = 3;
    return (
        <div>
            <div className="container" onMouseEnter={() =>setV(!visible)} onMouseLeave={() =>setV(!visible)}>
                <img src={props.image} alt={"kek"} className={'image grow '}/>
                    <button onMouseDown={() => dispatch({type:'INCQ',price:3})} className={'btn btn-primary ' } style={{visibility: visible ? "visible": "hidden"} } >+</button>
            </div>
        </div>
  )
};

export default Template;
